class Node(object):    def __init__(self, data):        self.data = data        self.left = None        self.right = None    def insert(self, data):        if self.data:            if data < self.data:                if self.left is None:                    self.left = Node(data)                else:                    self.left.insert(data)            elif data > self.data:                if self.right is None:                    self.right = Node(data)                else:                    self.right.insert(data)        else:            self.data = data    def display(self):        if self.left:            self.left.display()        print(self.data, end=' ')        if self.right:            self.right.display()node = Node(10)node.insert(5)node.insert(50)node.insert(44)node.display()